<?php

namespace App\Jobs;

use Illuminate\Contracts\Queue\ShouldQueue;
use Illuminate\Foundation\Queue\Queueable;
use Illuminate\Support\Facades\Http;
use Log;
class askLLM implements ShouldQueue
{
    use Queueable;

    /**
     * Create a new job instance.
     */
    public function __construct()
    {
        //
    }

    /**
     * Execute the job.
     */
    public function handle(): void
    {
        Log::info("Starting");
               $imageData = "data:image/jpeg;base64,";
$payload = [
    'model'  => 'gemma3:4b',
    'prompt' => 'You are a movie expert and based on the movie cover you identify the movie and you return the title, year and director in JSON. You are not allowed to guess. If you do not know, return null.',
    'image'  => $imageData,
];

$response = Http::timeout(900)
    ->withOptions(['stream' => true])
    ->withHeaders(['Content-Type' => 'application/json'])
    ->post('http://192.168.0.24:11434/api/generate', $payload);

$body = '';
foreach ($response->getBody() as $chunk) {
    $body .= $chunk;
    Log::info("Chunk received: " . $chunk);
}

// Once finished
$result = json_decode($body, true);
Log::info($result);

    }
}
